import '../CSS/About.css'

function CardContainer() {
    const services = [
        { id: 1, title: "Service 1", description: "This is Service 1", imageUrl: "service-image1.jpg" },
        { id: 2, title: "Service 2", description: "This is Service 2", imageUrl: "service-image2.jpg" },
    ];    return (
              <div className="card-container">
            {services.map(service => (
                <ServiceCard
                    key={service.id}
                    title={service.title}
                    description={service.description}
                    imageUrl={service.imageUrl}
                />
            ))}
        </div>
    );
}

